import React from "react";
import { Link } from "react-router-dom";
import { motion } from "framer-motion";

const Home = () => {
  return (
    <motion.div className="home container"
    animate={{
       opacity:0.2, 
       marginTop:200, 

    }}
    >
      <motion.h2
        animate={{
          fontSize: 50,
          color:'#ff2994', 
          x: 100, 
          y: -100
        }}
      >
        Welcome to Pizza Joint
      </motion.h2>
      <Link to="/base">
        <motion.utton
        animate={{
          scale:1.5
        }}
        >

          Create Your Pizza
        </motion.utton>
      </Link>
    </motion.div>
  );
};

export default Home;
